import React from 'react'
import "./Buttons.css";
function Buttons() {
  return (
    <div className="buttons">
        <button className='startBtn'>Start</button>
        <button className="stopBtn">Stop</button>
        <button className='resetBtn'>Reset</button>
    </div>
  )
}

export default Buttons
